import React,{ Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{
  constructor(){
    super();
    this.state = {
      monsters: [
        {name: "Frank", 
          id: "One"
        },
        {name: "Bill", 
          id: "Two"
        },
        {name: "Taylor", 
          id: "Three"
        },
        {name: "Mark", 
          id: "Four"
        }
      ]
    };

  }
  render() {
    return (
      <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          {
            this.state.monsters.map((monster) => {
              return this.name ;
            })
          }
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
    )
  }
}

export default App;
